import React from 'react'

// Import components
import Button from "./Button"

// Import SVG Assets
import { ReactComponent as UpArrow } from "../../assets/up-arrow.svg"
import { ReactComponent as DownArrow } from "../../assets/down-arrow.svg"

export default function Product(props) {
    return (
        <div className={ props.key === 4 ? "product product-curve" : "product" }>
            <div className="product__info">
                <p className="product__info__name"><em>LIQID {props.name}</em></p>
                <div className="product__info__details" style={props.growth ? {backgroundColor: "#E5FFC7"} : {backgroundColor: "#FFC7C7"}}>
                    <p className="product__info__details__value">{props.value} â‚¬</p>
                    {props.growth ? <UpArrow className="product__details__icon" /> : <DownArrow className="product__info__details__icon" />}
                    <p className="product__info__details__percent">{ props.percentage }%</p>
                </div>
            </div>
            <Button />
        </div>
    )
}
